@Override
public int compare(SuggestWord first, SuggestWord second) {
  // first criteria: the distance
  if (first.score > second.score) {
    return 1;
  }
  if (first.score < second.score) {
    return -1;
  }

  // second criteria (if first criteria is equal): the popularity
  if (first.freq > second.freq) {
    return 1;
  }

  if (first.freq < second.freq) {
    return -1;
  }
  return 0;
}

